webpackJsonp([95197605631765],{2181:function(e,o){e.exports={pathContext:{docHtml:"<h1>colorspace</h1>\n<p>Colorspace is a simple module which generates HEX color codes for namespaces.\nThe base color is decided by the first part of the namespace. All other parts of\nthe namespace alters the color tone. This way you can visually see which\nnamespaces belong together and which does not.</p>\n<h2>Installation</h2>\n<p>The module is released in the public npm registry and can be installed by\nrunning:</p>\n<pre><code>npm install --save colorspace\n</code></pre>\n<h2>Usage</h2>\n<p>We assume that you've already required the module using the following code:</p>\n<pre><code class=\"language-js\">'use strict';\n\nvar colorspace = require('colorspace');\n</code></pre>\n<p>The returned function accepts 2 arguments:</p>\n<ol>\n<li><code>namespace</code> <strong>string</strong>, The namespace that needs to have a HEX color\ngenerated.</li>\n<li><code>delimiter</code>, <strong>string</strong>, <strong>optional</strong>, Delimiter to find the different\nsections of the namespace. Defaults to <code>:</code></li>\n</ol>\n<h4>Example</h4>\n<pre><code class=\"language-js\">console.log(colorspace('color')) // #6b4b3a\nconsole.log(colorspace('color:space')) // #796B67\n</code></pre>\n<h2>License</h2>\n<p>MIT</p>",docPath:"argo-ci/node_modules/colorspace/readme",proj:"argo-ci"}}}});
